def generate_define_lines(input_data, output_file):
    with open(output_file, 'w') as f_out:
        words = input_data.split()
        for word in words:
            define_line = f"#define {word}  (*(volatile uint8_t *)(0x69))"
            f_out.write(define_line + "\n")

